import React, { Component } from "react";
import { Link, NavLink } from "react-router-dom";
import DropdownMenu from "../common/DropdownMenu";
import logo from "../assets/logoWithText.png";

class NavBarMenu extends Component {
  render() {
    return (
      <nav
        id="navbar"
        className="navbar navbar-expand-lg navbar-light justify-content-between"
      >
        <Link className="navbar-brand" to="/home">
          <img src={logo} alt="bluxury-catering" width="250" height="60" />
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarNavDropdown"
          aria-controls="navbarNavDropdown"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse  " id="navbarNavDropdown">
          <ul className="navbar-nav ml-auto " id="navbarItems">
            <NavLink className="nav-item nav-link" to="/逆光記憶">
              逆光記憶
            </NavLink>
            <NavLink className="nav-item nav-link" to="/響粹">
              響粹
            </NavLink>

            <DropdownMenu
              title={"品牌故事"}
              items={["藍穎餐飲", "逆光記憶", "響粹"]}
            />
            <DropdownMenu
              title={"安心食材"}
              items={["麵粉", "乳製品", "生鮮肉品", "生鮮蔬菜"]}
            />
            <Link className="nav-item nav-link" to="/購物車">
              <i
                className="fa fa-shopping-cart"
                aria-hidden="true"
                style={({ cursor: "pointer" }, { fontSize: "40px" })}
              />
            </Link>
          </ul>
        </div>
      </nav>
    );
  }
}

export default NavBarMenu;
